import React from 'react'
import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'ID',
        selector: row => row.unique_id,
    },
    {
        name: 'Names',
        selector: row => row.names,
    },
    {
        name: 'Flight Risk',
        selector: row => row.risk,
    },
    {
        name: 'Monday',
        selector: row => row.day,
    },
];




const OrderTable  = () => {
  return (
    <>
    <DataTable
            columns={columns}
            data={data}
            selectableRows
        />
    </>
  )
}

export default OrderTable
